const {LoginRequest, LoginResponse} = require('./generated/proto/login_pb');
const {LoginClient} = require('./generated/proto/login_grpc_web_pb');

var loginService = new LoginClient('http://0.0.0.0:8080',null,null);


export function loginWithToken(token){

	var request = new LoginRequest();
	request.setGoogleToken(token);

	loginService.login(request, {}, function(err, response) {
	  // ...
	  console.log("done with calls")
	  console.log(err)
	  console.log(response)
	});
}
